import './App.css';
import { Routes, Route, Navigate, useLocation } from 'react-router-dom';
import Home from './components/home'


function App() {
  return (
    <div className="wrapper">
      <h1>Application</h1>
      <Routes>
          <Route path="/home">
            <Home />
          </Route>
          <Route path="*" element={<Navigate to="/" />} />
      </Routes>
    </div>
  );
}

export default App;
